            <h4>usdLiquidity: {crpto.usdLiquidity}</h4>
            <h4>usdPrice: {crpto.usdPrice}</h4>
          </div>
          )})}
        {/* <button onClick={getData}>What Ye say</button> */}
      </div>
  );
}

export default App;
